	/**
	 * Converti un nombre dÈsignant une couleur, en la lettre designant la couleur
	 * @param k : 0 ou 1 ou 2
	 * @return 'R' ou 'G' ou 'B'
	 */
	private String convertCouleur(int k){
		switch (k){
		case 0:
			return "R";
		case 1:
			return "G";
		case 2:
			return "B";
		default:
			return null;
		}
	}
	
	
	/**
	 * Genere un graphe aleatoire coloriable : chaque sommet ‡ au maximum 2 voisins
	 * @param taille : la taille souhaitee du graphe
	 * @param ran : l'objet Random dÈj‡ initialisÈ pour mieux diffÈrencier les graphes
	 * @return String representant la matrice d'adjacence du graphe
	 */
	public static String genereGrapheColoriable(int taille, Random ran){
		StringBuilder sb = new StringBuilder();
		int[][] matrice = new int[taille][taille];
		int[] voisins = new int[taille];
		
		int cpt = 0;
		
		for (int i = 0; i < taille; i++){
			for (int j = 0; j < taille; j++){
				if (i == j) 
					matrice[i][j] = 0;
				else
					matrice[i][j] = -1;
			}
		}
		
		for (int i = 0; i < taille; i++){
			for (int j = 0; j < taille; j++){
				if ((matrice[i][j] == -1) && (voisins[i] < 2)){
					if (ran.nextBoolean()){
						matrice[i][j] = 1;
						matrice[j][i] = 1;
						voisins[i] = voisins[i] + 1;
						voisins[j] = voisins[j] + 1;
					} else {
						matrice[i][j] = 0;
						matrice[j][i] = 0;
					}
				} else if ((matrice[i][j] == -1)){
					matrice[i][j] = 0;
					matrice[j][i] = 0;
				}
			}
		}
		
		for (int i = 0; i < taille; i++){
			for (int j = 0; j < taille; j++){
				sb.append(matrice[i][j]);
			}
		}
		
		return sb.toString();
	}
	
